import React from "react";
import Cards from "./Cards";
import "./App.css";
import Sdata from "./Sdata";

function ndata(val) {
  console.log(val);

  return (
    <Cards
      imgsrc={val.imgsrc}
      title={val.title}
      sname={val.sname}
      link={val.link}
    />
  );
}

function App() {
  return (
    <>
      <h1 className="heading">List of Top 5 Netflix series</h1>
      {Sdata.map((v))}
    </>
  );
}

export default App;
